import React from "react";

export const Statistics = (title, statss) => {

    return (<section class="statistics">
        <h2 class="title">{ title }</h2>
        <ul class="stat-list">
            {stats.map(item => {
                return (<li class="item">
                    <span class="label" key={item.id}> {item.label} </span>
                    <span class="percentage" key={item.id}> {item.percentage} </span>
                </li>)
            })}
        </ul>
    </section>
    );
}
